import compatible from '../../../assets/Products/product-main/tiles/compatible.svg'
import chip from '../../../assets/Products/product-main/tiles/chip.svg'
import noflame from '../../../assets/Products/product-main/tiles/non-flammable.svg'
import standards from '../../../assets/Products/product-main/tiles/standards.svg'

const productTiles = [
    {
        img: material,
        desc: 'Metal galvanized containers, powder coated according to the RAL palette'
    },
    {
        img: construction,
        desc: 'Reinforced structure'
    },
    {
        img: warranty,
        desc: 'Lifetime warranty on self-discharge handles'
    },
    {
        img: warranty,
        desc: 'Lifetime warranty on self-discharge handles'
    },
    {
        img: compatible,
        desc: 'The containers work with all devices operating on the municipal market according to the requirements of DIN 30700'
    },
    {
        img: chip,
        desc: 'CHIP identification possible'
    },
    {
        img: noflame,
        desc: 'Containers are non-flammable'
    },
    {
        img: standards,
        desc: 'The containers meet the requirements of PN-EN 840'
    },
]

const ProductMain = () => {
    return (
        <div className='product-main'>
            product-main
            <div className='product-tiles'>
                <ProductTile />
                <ProductTile />
                <ProductTile />
            </div>
        </div>
    )
}

export default ProductMain;
